### Using `useEffect` to Fetch Data

Here’s a step-by-step guide on how to use `useEffect` to fetch data from an API and handle the response in a React component:

#### 1. Import Necessary Hooks

First, import the `useState` and `useEffect` hooks from React:

```jsx
import React, { useState, useEffect } from 'react';
```

#### 2. Define the Component

Create a functional component where you will fetch the data:

```jsx
const DataFetchingComponent = () => {
  // State to store the fetched data
  const [data, setData] = useState(null);
  // State to handle loading status
  const [loading, setLoading] = useState(true);
  // State to handle errors
  const [error, setError] = useState(null);

  // useEffect to fetch data when the component mounts
  useEffect(() => {
    // Define an async function to fetch data
    const fetchData = async () => {
      try {
        // Make the API call
        const response = await fetch('https://api.example.com/data');
        // Check if the response is ok (status in the range 200-299)
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        // Parse the JSON data
        const result = await response.json();
        // Update the state with the fetched data
        setData(result);
      } catch (err) {
        // Handle any errors
        setError(err.message);
      } finally {
        // Update the loading state
        setLoading(false);
      }
    };

    // Call the async function
    fetchData();
  }, []); // Empty dependency array means this effect runs once on mount

  // Render the component
  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h1>Fetched Data</h1>
      <pre>{JSON.stringify(data, null, 2)}</pre>
    </div>
  );
};

export default DataFetchingComponent;
```

### Explanation

1. **State Management**:
   - `data`: Stores the fetched data.
   - `loading`: Indicates whether the data is still being fetched.
   - `error`: Stores any error message that occurs during the fetch.

2. **useEffect Hook**:
   - The `useEffect` hook runs after the component mounts.
   - An async function `fetchData` is defined inside the effect to handle the fetch operation.
   - The `fetch` API is used to make the request.
   - The response is checked for success. If the response is not ok, an error is thrown.
   - The JSON data is parsed and stored in the `data` state.
   - Errors are caught and stored in the `error` state.
   - The `loading` state is set to `false` after the fetch operation completes, regardless of success or failure.

3. **Conditional Rendering**:
   - While loading, a loading message is displayed.
   - If an error occurs, the error message is displayed.
   - Once data is successfully fetched, it is displayed in a formatted JSON block.

### Summary

- **useEffect**: Runs side effects in functional components.
- **useState**: Manages component state.
- **fetch**: Makes HTTP requests.
- **Error Handling**: Catches and displays errors.
- **Conditional Rendering**: Displays loading, error, or data based on state.

This approach ensures that your component fetches data efficiently and handles loading and error states gracefully.

